import React from "react";
import "./home.css";
import { Search, ArrowUpward } from "@material-ui/icons";

const Home = () => {
  return (
    <div className="Home_container">
      <div>
        <span>{/* <Search /> */}</span>
      </div>
      <div>
        <h1>City Name</h1>
        <h1>Date</h1>
      </div>
      <div>
        <h2>img</h2>
        <div>
          <h1>
            27<span>o</span>
          </h1>
          <span>Partly Cloudy</span>
        </div>
      </div>
      <div>
        <span>Hourly Forecast</span>
        <span>Weekly Forecast</span>
      </div>
    </div>
  );
};

export default Home;
